// pages/canvas/canvas.js
Page({

    /**
     * 页面的初始数据
     */
    data: {

        // 用户信息
        userInfoData: {
            userName: 'autumn',
            userAvatar: 'https://6c69-liuchaojie-dev-1302189063.tcb.qcloud.la/private/applet_avatar.png',
            userJob: 'web前端'
        },

        // 活动信息
        actDetailInfo: {
            file_path: 'https://6c69-liuchaojie-dev-1302189063.tcb.qcloud.la/common/1591338002652.png',
            title: '南开大学103周年校庆～北京校友会歌•咏雅集活动，欢迎大家踊跃报名！',
            date_range: '2022年10月01日-2023年10月01日',
            address: '南开大学图书馆',
            contact: '南开小帮手',
            qrCodeUrl: 'data:image/jpeg;base64,'
        },

        bottomShadowFlag: false, // 画布遮罩
    },

    /**
     * 生命周期函数--监听页面加载
     */
    onLoad: function (options) {

    },

    // 绘制canvas
    async drawCanvasFun(){
        const ctx = wx.createCanvasContext('myCanvas');
        const {windowWidth, windowHeight} = wx.getSystemInfoSync();// 获取设备宽度
        const { userInfoData, actDetailInfo } = this.data;

        // canvas背景色
        ctx.setFillStyle('#FFFFFF'); // transparent
        ctx.fillRect(0, 0, windowWidth, 540);

        // 绘制带边框的圆角头像
        // 图片的x坐标
        let bg_x = 10
        // 图片的y坐标
        let bg_y = 10
        // 图片宽度
        let bg_w = 40
        // 图片高度
        let bg_h = 40
        // 图片圆角
        let bg_r = 20

        // 绘制海报背景图片圆角
        ctx.save()
        ctx.beginPath()
        ctx.setFillStyle('#bbffaa'); // 背景色
        ctx.setStrokeStyle('#BEBEBE');
        ctx.arc(bg_x + bg_r, bg_y + bg_r, bg_r, Math.PI, Math.PI*1.5)
        ctx.arc(bg_x + bg_w - bg_r, bg_y + bg_r, bg_r, Math.PI * 1.5, Math.PI * 2)
        ctx.arc(bg_x + bg_w - bg_r, bg_y + bg_h - bg_r, bg_r, 0, Math.PI * 0.5)
        ctx.arc(bg_x + bg_r, bg_y + bg_h - bg_r, bg_r, Math.PI * 0.5, Math.PI)

        // 绘制边框
        ctx.lineTo(bg_x, bg_y + bg_r);
        ctx.fill();
        ctx.stroke();
        ctx.closePath();

        ctx.clip()
        let avatar_tempFilePath = await this.wxDownloadFileFun(userInfoData.userAvatar);
        ctx.drawImage(avatar_tempFilePath, bg_x, bg_y, bg_w, bg_h)
        // 恢复之前保存的绘图上下文
        ctx.restore()

        // 用户名
        ctx.setFillStyle('#999999');
        ctx.setFontSize('12');
        ctx.setTextAlign('left');
        ctx.fillText(userInfoData.userName, 65, 25)

        // 职位
        ctx.setFillStyle('#333333');
        ctx.setFontSize('12');
        ctx.fillText(userInfoData.userJob, 65, 45)

        // 活动图片
        let activity_tempFilePath = '';
        if(actDetailInfo.file_path) {
            activity_tempFilePath = await this.wxDownloadFileFun(actDetailInfo.file_path);
        } else {
            activity_tempFilePath = '/images/contentCheck/upload.png';
        }
        ctx.drawImage(activity_tempFilePath, 10, 10, windowWidth - 20, 266)

        // 标题
        ctx.setFillStyle('#000000');
        ctx.font = 'normal bold 16px sans-serif'
        ctx.fillText(this.fittingString(ctx, actDetailInfo.title, windowWidth - 20), 10, 305)

        // 日期
        ctx.setFillStyle('#000000');
        ctx.font = 'normal 13px sans-serif'
        ctx.fillText(actDetailInfo.date_range, 10, 330)

        // 地址
        ctx.setFillStyle('#000000');
        ctx.fillText(this.fittingString(ctx, actDetailInfo.address, windowWidth - 20), 10, 355)

        // 名额
        ctx.setFillStyle('#000000');
        ctx.fillText('名额：999', 10, 380)

        // 联系人
        ctx.setFillStyle('#000000');
        ctx.fillText(`联系人：${actDetailInfo.contact}`, 10, 405)

        // 扫描二维码
        ctx.setFillStyle('#0080FF');
        ctx.fillText(`分享来源：${userInfoData.userName}校友`, 10, 470)
        // 扫码二维码
        ctx.setFillStyle('#0080FF');
        ctx.fillText('扫描二维码，立即报名', 10, 495)

        // 二维码图片（canvas不支持base64格式图片）
        let qrCodeUrl_tempFilePath = await this.base64Save(actDetailInfo.qrCodeUrl);
        ctx.drawImage(qrCodeUrl_tempFilePath, windowWidth - 115, 425, 100, 100)

        // ctx.draw()
        // 由于canvas不能缩放，所以隐藏真实canvas，使用image代替；
        ctx.draw(true, () => {
            wx.canvasToTempFilePath({
                canvasId: 'myCanvas',
                success: res => {
                    this.setData({
                        canvasToTempFilePathImg: res.tempFilePath
                    });
                    console.log('由于canvas不能缩放，所以隐藏真实canvas，使用image代替，图片路径为：',res.tempFilePath);
                },
                complete(res){
                    console.log(res);
                }
            })
        });
        wx.hideLoading();
    },

    // canvas base64图片处理
    base64Save(base64File) { //base64File 需要加前缀
        const fsm = wx.getFileSystemManager();//获取全局文件管理器
        let extName = base64File.match(/data\:\S+\/(\S+);/)
        if (extName) {
            //获取文件后缀
            extName = extName[1]
        }
        //获取自1970到现在的毫秒 + 文件后缀 生成文件名
        let fileName = Date.now() + '.' + extName
        return new Promise((resolve, reject) => {
            //写入文件的路径
            let filePath = wx.env.USER_DATA_PATH + '/' + fileName
            fsm.writeFile({
                filePath,
                data: base64File.replace(/^data:\S+\/\S+;base64,/, ''), //替换前缀为空
                encoding: 'base64',
                success:(res)=>{
                    console.log('base64二维码图片处理后的filePath',filePath); //路径：http://user.....
                    resolve(filePath);
                },
                fail() {
                    reject('写入失败');
                },
            });
        });
    },

    //canvas单行文本自动省略
    fittingString(_ctx, str, maxWidth) {
        let strWidth = _ctx.measureText(str).width;
        const ellipsis = "…";
        const ellipsisWidth = _ctx.measureText(ellipsis).width;
        if (strWidth <= maxWidth || maxWidth <= ellipsisWidth) {
            return str;
        } else {
            var len = str.length;
            while (strWidth >= maxWidth - ellipsisWidth && len-- > 0) {
                str = str.slice(0, len);
                strWidth = _ctx.measureText(str).width;
            }
            return str + ellipsis;
        }
    },

    // 网络图片通过下载转换成临时路径
    wxDownloadFileFun(originUrl){
        return new Promise( (resolve, reject) => {
            wx.downloadFile({
                url: originUrl,
                success: res => {
                    if (res.statusCode===200){
                        resolve(res.tempFilePath);
                    }
                }
            })
        });
    },

    // 生成canvas
    generateCanvasFun(){
        wx.showLoading({
            title: '加载中',
        })
        this.setData({
            bottomShadowFlag: true
        });
        this.drawCanvasFun();
    },

    // 取消
    cancelFun(){
        this.setData({
            bottomShadowFlag: false
        });
    },

    // 保存canvas
    saveImage () {
        wx.canvasToTempFilePath({
            x: 0,
            y: 0,
            canvasId: 'myCanvas',
            success: (res) => {
                console.log('success');
                console.log(res);
                //成功之后保存到本地
                wx.saveImageToPhotosAlbum({
                    filePath: res.tempFilePath,
                    success: (result) =>  {
                        console.log('保存成功', result);
                        wx.showToast({
                            title: '保存成功',
                            icon: 'success',
                            duration: 2000
                        });
                    },
                    fail: (result) =>  {
                        console.log('fail', result);
                    },
                    complete: (result) => {
                        console.log('complete', result, this);
                        this.setData({
                            bottomShadowFlag: false
                        });
                    }
                });
            },
            fail: (res) => {
                console.log('fail');
                console.log(res);
            },
            complete: (res) => {
                console.log('complete');
                console.log(res);
            }
        });
    }
})
